import React from 'react';

import NavBar from '../../UI/NavBar';
import Footer from '../../UI/Footer';
import ProductList from './ProductList';
import classes from './Shop.module.css';

const Shop = () => {
  return (
    <>
      <NavBar />
      <div className={classes.shop_banner}>
        <header>SHOP</header>
        <p>SHOP</p>
      </div>
      <ProductList />
      <Footer />
    </>
  );
};

export default Shop;
